import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { View } from 'react-native';

function RecordingScreen(props) {
    return (
        <View style={styles.container}>
            <View style={{
                flex: 1,
                backgroundColor: '#fff',
                justifyContent: 'center',
                alignItems: 'center'
            }}>
                <TouchableOpacity
                    style={{
                        width: 130,
                        borderRadius: 4,
                        backgroundColor: '#14274e',
                        flexDirection: 'row',
                        justifyContent: 'center',
                        alignItems: 'center',
                        height: 40
                    }}
                >
                    <Text style={{
                        color: '#fff',
                        fontWeight: 'bold',
                        textAlign: 'center'
                    }}>
                        Take picture
                    </Text>
                </TouchableOpacity>
            </View>
            <StatusBar style="auto" />
        </View>
    );
}

